script: |
  super -f text -I q6640.spq | sort > q6640.out

inputs:
  - name: q6640.spq
    data: |
      SELECT ALL - 80 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( + col0 ) + + - col2 NOT BETWEEN + 26 * + col0 * + - col2 * col1 AND + col0 - + col2 - 5;
  - name: tab0

outputs:
  - name: q6640.out
    data: |
